import React from 'react';
import './Footer.css';

function Footer() {
  return (
    <div className='footer-container'>
      <section className='footer-subscription'>
        <marquee>
        <h1> Thank you for making it to the end of the page</h1>
        </marquee>
        <h3>Hopefully you enlightened yourself </h3>  
      </section> 
    </div>
  );
}

export default Footer;
